import React from "react";

function Card(props){
    return(
        <div>
            <div class="card" style= {{width: "25rem", backgroundColor: "#f6376d"}}>
                <div class="card-body" style={{color:"white", padding: "5px"}}>
                <h5 class="card-title" style={{fontSize: "25px"}}>{props.name}</h5>
                <p class="card-text">{props.desc}</p>
            
                </div>
            </div>
        </div>
    )
}

export default Card;
